import { useParams } from "react-router-dom"
import Form from "../Comps/Form"

function FormPage(){
    const params = useParams()
    return (
        <div className="form_section">
           <h3> Correction Form {params.id}</h3>
            <Form/>
        </div>
    )
}
export default FormPage
